import React from 'react';
import { Container } from 'react-bootstrap';

// Import your custom icons (replace with actual paths)
import exploreIcon from '.public/static/ExploreIcon.png';
import statisticIcon from './static/StatisticIcon.png';
import searchIcon from './static/ProfileIcon.png';
import profileIcon from './static/ProfileIcon.png';
import settingsIcon from './static/SettingIcon.png';

// Define handler functions
const MobileExploreHandler = () => {
  console.log('Explore clicked');
};

const MobileStatisticHandler = () => {
  console.log('Statistics clicked');
};

const MobileSearchHandler = () => {
  console.log('Search clicked');
};

const MobileProfileHandler = () => {
  console.log('Profile clicked');
};

const MobileSettingHandler = () => {
  console.log('Settings clicked');
};

const MobileNavigationBar: React.FC = () => {
  return (
    <Container className="d-flex justify-content-around py-3 border-top bg-white fixed-bottom">
      <button onClick={MobileExploreHandler} className="nav-button">
        <img src={exploreIcon} alt="Explore" className="nav-icon" />
      </button>

      <button onClick={MobileStatisticHandler} className="nav-button">
        <img src={statisticIcon} alt="Statistics" className="nav-icon" />
      </button>

      <button onClick={MobileSearchHandler} className="nav-button">
        <img src={searchIcon} alt="Search" className="nav-icon" />
      </button>

      <button onClick={MobileProfileHandler} className="nav-button">
        <img src={profileIcon} alt="Profile" className="nav-icon" />
      </button>

      <button onClick={MobileSettingHandler} className="nav-button">
        <img src={settingsIcon} alt="Settings" className="nav-icon" />
      </button>
    </Container>
  );
};

export default MobileNavigationBar;




